Доступная сумма кредита от 50 000 до 3 500 000 руб. Без первоначального взноса по двум документам.
** За дополнительной информацией обращайтесь к менеджерам автосалона. Место осмотра ул. Аэропортовское шоссе 29, напротив Тойота центра.
